DELIMITER $$
CREATE TRIGGER `calculate_amount_after_vat_in` BEFORE INSERT ON `invoice_in` FOR EACH ROW BEGIN
    -- Check if VAT is included
    IF NEW.vat_included = 1 THEN
        -- Fetch the correct VAT rate based on the issue_date
        SET NEW.vat_rate_id = (
            SELECT id
            FROM vat_rates 
            WHERE NEW.issue_date BETWEEN start_date AND IFNULL(end_date, CURDATE())
            ORDER BY start_date DESC LIMIT 1
        );
        
        -- Check if a valid VAT rate was found
        IF NEW.vat_rate_id IS NOT NULL THEN
            -- Calculate amount_after_vat based on the found VAT rate
            SET NEW.amount_after_vat = NEW.amount + (
                NEW.amount * IFNULL(
                    (SELECT vat_value FROM vat_rates WHERE id = NEW.vat_rate_id), 
                0) / 100);
        ELSE
            -- If no valid VAT rate found, set vat_rate_id to NULL and use default rate of 5%
            SET NEW.vat_rate_id = NULL;
            SET NEW.amount_after_vat = NEW.amount + (NEW.amount * 5 / 100);
        END IF;
        
    ELSE
        -- If VAT is not included, set amount_after_vat to the original amount
        SET NEW.vat_rate_id = NULL;
        SET NEW.amount_after_vat = NEW.amount;
    END IF;
END
$$
DELIMITER ;
